*
 * 以 Toast 方式显示客户端信息
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {Object} params - 传入的参数
 * @param {string} params.msg - 要展示的消息
 * @param {string} params.markType - 要展示的符号，默认为0。说明：0,空;1,翻书;2对号;3感叹号;4,等待loading;
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('toast', {
 *    params: {
 *        msg: 'live a happy life',
 *    },
 * }).then(function (info) {
 *    alert('[from ready][toast][then] ' + JSON.stringify(info, null, 2));
 * }).catch(function (err) {
 *    alert('[from ready][toast][error] ' + JSON.stringify(err, null, 2));
 * });
 *

